
// 3735. Lexicographically Smallest String After Reverse II
// https://leetcode.com/problems/lexicographically-smallest-string-after-reverse-ii/

/* intuition
 * - brute force will lead to TLE
 * - need fast way to compare string
 * - better even, need a fast way to compare substrings
 * - precompute what we can to speed things up
 * - for string compare including substrings Rabin-Karp comes to mind
 * - key insight: a hash does not enable us to determine which string is smaller,
 *   but we could via binary search determine the 1st position where the hash is different
 *   then we can compare that position to determine which string is smaller
 * - potential problem with that is, that we may find a position where the 
 *   hash is equal, but there could still be positions to the left where the hash is different
 *   why? the right sequence of chars could lead to the hash convergence and then become equal again
 *   we could compensate for that calculating 2 hashes with different moduli
 */

// initialize once
long long p_pow[100000];
bool init = false;

class Solution {
public:
    string lexSmallest(string s) {
        // 1 <= s.length <= 1e5; lowercase chars

        const int p = 31;
        const int m = 1e9 + 9;

        if( !init ) {
            p_pow[0] = 1;
            for(int i = 1; i < 100000; i++)
                p_pow[i] = (p_pow[i-1] * p) % m;
            init = true;
        }

        int n = s.size();
        if( n == 1 )
            return s;
        if( n == 2 ) {
            if( s[0] > s[1] )
                swap(s[0],s[1]);
            return s;
        }
        // no need to proceed if only one distinct char
        bool seen[26];memset(seen,false,sizeof seen);
        int distinct_chrs = 0;
        for(char c : s) {
            if( !seen[c-'a'] )
                ++distinct_chrs;
            if( distinct_chrs > 1 )
                break;
            seen[c-'a'] = true;
        }
        if( distinct_chrs == 1 )
            return s;        

        // let s1 and s2 be strings of the same length
        // the goal is to quickly determine if one string is less than the other
        // we use a rolling hash and binary search
        // we are looking for the left most pos at which the hash is different
        // we can then use that position to determine which string is smaller
        //         0123456
        // example abcdefg
        //         abcbxyz
        //         ---
        // up to and incl. pos 2 the hash will be the same, so once we know that,
        // we can compare pos 3 to get our answer

        long long h_fwd[100001];
        h_fwd[0] = 0;

        string s_rev = s;
        reverse(begin(s_rev), end(s_rev));
        long long h_rev[100001];
        h_rev[0] = 0;        

        // only try to reverse a left part at positions where s[i] is smallest char in s
        // hence also keeping track of smallest char
        char smallest_chr = 'z';

        for(int i = 0; i < n; ++i) {
            h_fwd[i+1] = (h_fwd[i] + (s[i] - 'a' + 1) * p_pow[i]) % m;
            h_rev[i+1] = (h_rev[i] + (s_rev[i] - 'a' + 1) * p_pow[i]) % m;
            smallest_chr = min(smallest_chr, s[i]);
        }


        string best = s;

        // reverse a left part 0..i where 0 < i < n 
        int bif = n; // best index i found
                     // as long as bif is 0, we have not found a better string
        for(int i = n-1; i >= 1; --i) {
            if( s[i] != smallest_chr )
                continue;

            // we are "reversing" s 0..i inclusive
            // example
            //              01234567
            // let s     = "abecbafg"
            //              ------
            // let s_rev = "gfabceba"
            //                ------
            //              01234567
            // let us assume i = 5 => we reverse 0..5 inclusive
            // forward  s         0 .. 5
            // reversed s_rev     2 .. 7
            // reversed s_rev n-1-i .. n-1 generally

            // begin index in s_rev, aka our offset
            int b = n - 1 - i;
            
            // begin index in s_rev at bif
            int b_bif = n - 1 - bif;

            // binary search
            int lo = 0;
            int hi = i+1;
            while( lo < hi ) {
                int mid = lo + (hi - lo) / 2;
                long long hf;
                long long hr;

                if( bif == n ) { 
                    // h_fwd[mid+1] adjusted to make it like it starts at pos b
                    hf = h_fwd[mid+1] * p_pow[b] % m;
                    hr = (h_rev[b+mid+1] + m - h_rev[b]) % m;
                } else {
                    hf = (h_rev[b_bif+mid+1] + m - h_rev[b_bif]) % m;
                    // need to adjust hf to make it like it starts at pos b
                    hf = hf * p_pow[bif-i] % m;
                
                    hr = (h_rev[b+mid+1] + m - h_rev[b]) % m;
                }
                
                if( hf != hr )
                    hi = mid;
                else
                    lo = mid + 1;
            }

            if( hi == i+1 ) { // s[0..i] == s_rev[b..n-1]
                if( bif == n ) {
                    if( s[i+1] < best[i+1] ) {
                        // noop
                    } else {
                        continue;
                    }
                } else {
                    if( s[i+1] < s_rev[b_bif+i+1] ) {
                        // noop
                    } else {
                        continue;
                    }
                }
            }

            if( bif == n ) {
                if( best[hi] > s_rev[b+hi] )
                    bif = i;
            } else {
                if( s_rev[b_bif+hi] > s_rev[b+hi] )
                    bif = i;
            }
        }
        

        // rebuild entire h_fwd if best index forward != n
        if( bif != n ) {
            int b = n - 1 - bif;
            best = s_rev.substr(b) + s.substr(bif+1);
            for(int i = 0; i < n; ++i)
                    h_fwd[i+1] = (h_fwd[i] + (best[i] - 'a' + 1) * p_pow[i]) % m;
        }


        // reverse a right part i..n-1 where 0 < i < n-1
        int bir = 0; // best index i found
                     // as long as bir is 0, we have not found a better string
        for(int i = 1; i < n-1; ++i) {
            if( bir == 0 ) {
                if( s[i-1] > best[i-1] )
                    break;
            } else {
                if( s[i-1] > s_rev[i-bir-1] )
                    break;
            }

            if( bir == 0 ) {
                if( s[n-1] > best[i] )
                    continue;
            } else {
                if( s[n-1] > s_rev[i-bir] )
                    continue;
            }

            // we are "reversing" s i..n-1 inclusive
            // example
            //              01234567
            // let s     = "abecbafg"
            //                ------
            // let s_rev = "gfabceba"
            //              ------
            //              01234567
            // let us assume i = 2 => we reverse 2..n-1 inclusive
            // forward  s         2 .. n-1
            // reversed s_rev     0 .. 5
            // reversed s_rev     0 .. n-1-i generally

            // binary search
            int lo = 0;
            int hi = n-i;
            while( lo < hi ) {
                int mid = lo + (hi - lo) / 2;
                long long hf;
                long long hr;
                if( bir == 0 ) {
                    hf = (h_fwd[i+mid+1] + m - h_fwd[i]) % m;
                    // h_rev[mid+1] adjusted to make it like it starts at pos i
                    hr = h_rev[mid+1] * p_pow[i] % m;
                } else {
                    // the way we are moving through through s
                    // we can get away with just using h_rev,
                    // eliminating the need to rebuild h_fwd
                    // assume we placed s_rev at index 4, we remeber bir = 4 
                    // 012345678901
                    // 0   i
                    // ----x-------
                    // s   s_rev
                    // assume we are now at index 6
                    // in order to assess if we can do better, all we 
                    // need to do is compare s_rev with s_rev considring the
                    // offset i-bir
                    // 012345678901
                    // 0     i
                    // ----x------- old
                    // s   s_rev    old
                    // ----  x----- new
                    // s     s_rev  new
                    // 
                    hf = (h_rev[i-bir+mid+1]+ m - h_rev[i-bir]) % m;
                    hr = h_rev[mid+1] * p_pow[i-bir] % m;
                }
                if( hf != hr )
                    hi = mid;
                else
                    lo = mid + 1;
            }

            if( hi == n-1 ) // s[i..n-1] == s_rev[0..n-1-i]
                 continue;
            
            if( bir == 0 ) {
                if( best[i+hi] > s_rev[hi] )
                    bir = i;
            } else {
                if( s_rev[i-bir+hi] > s_rev[hi] )
                    bir = i;
            }

        }
        if( bir > 0 )
            best = s.substr(0, bir) + s_rev.substr(0, n-bir);
        
        return best;
    }
};

